    function setmediaattribute(uint256 nftea_, string memory media_, string memory title_, uint256[] memory nfteas_, string[] memory medias_, string[] memory titles_) public {

        ///must be creator or operator of nftea not minter
        if(nfteas_.length>0){

            for (uint256 i = 0; i < nfteas_.length; ++i) {

                (address flame_) = i1155(_fire).gflame('mintstorage');
                (_nfteas,,) = i1155(flame_).getnftea(nfteas_[i]);
                if(_nfteas.settings[0]>0){
                    ///linked to label... validate operator
                    (flame_) = i1155(_fire).gflame('operatorstorage');
                    //validate operator
                    (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
                    require(opid_>0, 'invalid operator');
                    require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
                    (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
                    if(rolex_==1){
                        i1155(flame_).setmediaattribute(nfteas_[i], medias_[i], titles_[i]);
                    }
                }else{
                    i1155(flame_).setmediaattribute(nfteas_[i], medias_[i], titles_[i]);
                }
            }

        }else{

            (address flame_) = i1155(_fire).gflame('mintstorage');
            (_nfteas,,) = i1155(flame_).getnftea(nftea_);
            if(_nfteas.settings[0]>0){
                ///linked to label... validate operator
                (flame_) = i1155(_fire).gflame('operatorstorage');
                //validate operator
                (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
                require(opid_>0, 'invalid operator');
                require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
                (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
                require(rolex_==1, 'you are not a super oerpertor');

            }else{

                require(_nfteas.addresses[0]==msg.sender, 'only creator can add media attributes');

            }
            (bool success ) = i1155(flame_).setmediaattribute(nftea_, media_, title_);
            require(success, 'error setting attribute');
        }

    }
    function edit(uint256 nftea_, string memory ipfs_) public {

        (address flame_) = i1155(_fire).gflame('mintstorage');
        (_nfteas,,) = i1155(flame_).getnftea(nftea_);
        (flame_) = i1155(_fire).gflame('mintcontract');
        uint256 balance_ = IERC1155(flame_).balanceOf(msg.sender,nftea_);
        require(balance_==_nfteas.settings[6], 'must own all nfteas to edit');

        if(_nfteas.settings[0]>0){
            ///linked to label... validate operator
            (flame_) = i1155(_fire).gflame('operatorstorage');
            //validate operator
            (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
            require(opid_>0, 'invalid operator');
            require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
            (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
            require(rolex_==1, 'you are not a super oerpertor');
        }

        (flame_) = i1155(_fire).gflame('mintcontract');
        (bool success) = i1155(flame_).setedit(nftea_, ipfs_);
        require(success, 'error editing');
    }
    function checkSuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;

        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()

            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }

            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }

            // not sure what was returned: dont mark as success
            default { }

        }

        return returnValue != 0;
    }

